import React from 'react';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <Link className="navbar-brand" to="/">Air Quality Dashboard</Link>
        <div className="navbar-nav">
          <Link className="nav-link" to="/city/Toronto">Toronto</Link>
          <Link className="nav-link" to="/city/San Francisco">San Francisco</Link>
          <Link className="nav-link" to="/city/New York">New York</Link>
          <Link className="nav-link" to="/city/Dallas">Dallas</Link>
          <Link className="nav-link" to="/city/Boston">Boston</Link>
          <Link className="nav-link" to="/city/Miami">Miami</Link>
          <Link className="nav-link" to="/city/Houston">Houston</Link>
        </div>
      </div>
    </nav>
  );
}

export default Navigation;
